__NUXT_JSONP__("/drugs/Dual_IGF-1RInsR_Inhibitor_BMS-754807", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1001350-96-4",chebiId:"",chemicalFormula:"C23H26FN9O",definition:"An oral small molecule inhibitor of insulin-like growth factor 1 receptor (IGF-1R) and insulin receptor (InsR) tyrosine kinases with potential antineoplastic activity. Dual IGF-IR\u002FInsR inhibitor BMS-754807 binds reversibly to and inhibits the activities of IGF-1R and InsR, which may result in the inhibition of tumor cell proliferation and the induction of tumor cell apoptosis. IGF-1R and InsR tyrosine kinases, overexpressed in a variety of human cancers, play significant roles in mitogenesis, angiogenesis, and tumor cell survival.",fdaUniiCode:"W9E3353E8J",identifier:"C74043",preferredName:b,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C1967"],synonyms:["BMS-754807",b]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FDual_IGF-1RInsR_Inhibitor_BMS-754807",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Dual_IGF-1RInsR_Inhibitor_BMS-754807","Dual IGF-1R\u002FInsR Inhibitor BMS-754807","2021-10-30T13:44:18.103Z")));